import React from 'react'
import {createField,Input,Textarea} from '../../common/formsControls/formsControsl.tsx'
import {Contact} from './Profileinfo.js'
import {reduxForm} from 'redux-form'
import { GetStringCase } from '../../common/formsControls/formsControsl.tsx'
import { ProfileType } from '../../../types/types.js'

type PropsType = {}
type ProfileTypeKeys = GetStringCase<ProfileType>
const ProfileDataForm = ({handleSubmit,profile,error}) => {
    return <form onSubmit={handleSubmit}>
        <button>Save</button>
        {error && <div>{error}</div>}
            <div>
                <b>Full name: </b>{createField<ProfileTypeKeys>("Full name","fullName",Input,[],{},'')}
            </div>
            <div>
                <b>Looking for a job: </b>{createField("","lookingForAJob",Input,[],{type:'checkbox'},{},'')}
            </div>
                <div>
                    <b>Skills: </b>{createField("Skills","lookingForAJobDescription",Textarea,[])}
                </div>
            <div>
                <b>About me: </b>{createField("About me","aboutMe",Input,[])}
            </div>
            <div>
                <b>Contacts: </b> {Object.keys(profile.contacts).map(key => {
                    return  <div key={key}>
                        <b>{key}</b>{createField(key,'contacts.'+key,Input,[])} 
                    </div>
                })}
            </div>
        </form>
}
const ProfileDataFormRedux = reduxForm({form:'edit-profile'})(ProfileDataForm)
export default ProfileDataFormRedux
